description:
- Publicação da portaria para continuação da Comissão (portaria), com atribuições de: 
 * trabalhar para a proposição de capacitações para a atenção e encaminhamentos de casos;
 * propor maneiras de ampla divulgação dos procedimentos e informações sobre o tema na universidade;
 * assessorar a revisão da proposta de normativa para condução de casos de assédio e/ou violência no âmbito do Campus Pato Branco da UTFPR
